import React from "react";
import NFT from './NFT';

const supportedTokens = [
  {name: "Bored Ape", contractAddress: "0xbc4ca0eda7647a8ab7c2061c2e118a18a936f13d"}
]

function Tokens({number}) {
  return (
    <div className="flex flex-row text-center w-full font-semibold">
      {supportedTokens && supportedTokens.length > 0 && supportedTokens.map(item =>
        <NFT
          contractAddress={item.contractAddress}
          key={item.contractAddress}
          name={item.name}
          size={48}
          tokenId={number}
        />
      )}

      <NFT
        contractAddress="0x23581767a106ae21c074b2276d25e5c3e136a68b"
        name={"Moonbird"}
        size={48}
        tokenId={number}
      />
      <NFT
        contractAddress="0x2dff22dcb59d6729ed543188033ce102f14ef0d1"
        name={"Goopdood"}
        size={48}
        tokenId={number}
      />
      <NFT
        contractAddress="0xd9b78a2f1dafc8bb9c60961790d2beefebee56f4"
        name={"Tiny Dino"}
        size={48}
        tokenId={number}
      />
      <NFT
        contractAddress="0x97597002980134bea46250aa0510c9b90d87a587"
        name={"ChainRunner"}
        size={48}
        tokenId={number}
      />
    </div>
  );
}

export default Tokens;
